import React, { useState, useEffect } from 'react';
import { Form, Input, Button, Select, Row, Col } from 'antd';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const { Option } = Select;

const Home = ({ onFilter, properties }) => {
  const [cities, setCities] = useState([]);
  const [districts, setDistricts] = useState([]);
  const [selectedCityId, setSelectedCityId] = useState(null);
  const [loadingDistricts, setLoadingDistricts] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchCities = async () => {
      try {
        const response = await axios.get(
          'https://turkiyeapi.dev/api/v1/provinces'
        );
        setCities(response.data.data);
      } catch (error) {
        console.error('İller alınırken hata oluştu:', error);
      }
    };
    fetchCities();
  }, []);

  useEffect(() => {
    const fetchDistricts = async () => {
      if (!selectedCityId) return;
      setLoadingDistricts(true);
      try {
        const response = await axios.get(
          'https://turkiyeapi.dev/api/v1/provinces/districts/${selectedCityId}'
        );
        setDistricts(response.data.data);
      } catch (error) {
        console.error('İlçeler alınırken hata oluştu:', error);
      } finally {
        setLoadingDistricts(false);
      }
    };
    fetchDistricts();
  }, [selectedCityId]);

  const handleFilter = (values) => {
    const filtered = properties.filter(property => {
      return (
        (!values.name || property.ilanbaslik.includes(values.name)) &&
        (!values.minPrice || property.fiyat >= values.minPrice) &&
        (!values.maxPrice || property.fiyat <= values.maxPrice) &&
        (!values.city || property.il === values.city) &&
        (!values.district || property.ilce === values.district) &&
        (!values.category || property.kategori === values.category) &&
        (!values.type || property.tur === values.type) &&
        (!values.rooms || property.oda_sayisi === values.rooms)
      );
    });
    onFilter(filtered);
    navigate('/filtered-properties'); // Filtrelenen evlerin listeleneceği sayfaya yönlendirme
  };

  return (
    <div style={{ 
      backgroundImage: 'url(https://izcelikyapi.com/wp-content/uploads/2022/05/iki-katli-celik-ev-modelleri.webp)', 
      backgroundSize: 'cover', 
      backgroundPosition: 'center', 
      height: '100vh', 
      display: 'flex', 
      justifyContent: 'center', 
      alignItems: 'center',
      color: 'white',
      position: 'relative'
    }}>
      <div style={{ textAlign: 'center', width: '80%' }}>
        <h1 style={{ fontSize: '48px', fontWeight: 'bold' }}>Find Your New Home!</h1>
        <Form layout="vertical" onFinish={handleFilter} style={{ background: 'rgba(0, 0, 0, 0.5)', padding: '20px', borderRadius: '10px' }}>
          <Form.Item name="name">
            <Input placeholder="İlan Başlığı" />
          </Form.Item>
          <Row gutter={[16, 16]}>
            <Col span={6}>
              <Form.Item name="minPrice">
                <Input placeholder="Min Fiyat" type="number" />
              </Form.Item>
            </Col>
            <Col span={6}>
              <Form.Item name="maxPrice">
                <Input placeholder="Max Fiyat" type="number" />
              </Form.Item>
            </Col>
            <Col span={6}>
              <Form.Item name="city">
                <Select placeholder="İl seçin" onChange={setSelectedCityId} style={{ width: '100%' }}>
                  {cities.map(city => (
                    <Option key={city.id} value={city.id}>
                      {city.name}
                    </Option>
                  ))}
                </Select>
              </Form.Item>
            </Col>
            <Col span={6}>
              <Form.Item name="district">
                <Select placeholder="İlçe seçin" loading={loadingDistricts} disabled={!selectedCityId} style={{ width: '100%' }}>
                  {districts.map(district => (
                    <Option key={district.id} value={district.name}>
                      {district.name}
                    </Option>
                  ))}
                </Select>
              </Form.Item>
            </Col>
          </Row>
          <Row gutter={[16, 16]}>
            <Col span={6}>
              <Form.Item name="category">
                <Select placeholder="Kategori seçin" style={{ width: '100%' }}>
                  <Option value="daire">Daire</Option>
                  <Option value="villa">Villa</Option>
                  <Option value="yazlık">Yazlık</Option>
                  <Option value="müstakil ev">Müstakil Ev</Option>
                  <Option value="residence">Residence</Option>
                </Select>
              </Form.Item>
            </Col>
            <Col span={6}>
              <Form.Item name="type">
                <Select placeholder="Tür seçin" style={{ width: '100%' }}>
                  <Option value="kiralik">Kiralık</Option>
                  <Option value="satilik">Satılık</Option>
                </Select>
              </Form.Item>
            </Col>
            <Col span={6}>
              <Form.Item name="rooms">
                <Select placeholder="Oda Sayısı" style={{ width: '100%' }}>
                  <Option value="Tümü">Tümü</Option>
                  <Option value="Stüdyo (1+0)">Stüdyo (1+0)</Option>
                  <Option value="1+1">1+1</Option>
                  <Option value="1.5+1">1.5+1</Option>
                  <Option value="2+0">2+0</Option>
                  <Option value="2+1">2+1</Option>
                  <Option value="2.5+1">2.5+1</Option>
                  <Option value="2+2">2+2</Option>
                  <Option value="3+0">3+0</Option>
                  <Option value="3+1">3+1</Option>
                  <Option value="3.5+1">3.5+1</Option>
                  <Option value="3+2">3+2</Option>
                  <Option value="3+3">3+3</Option>
                  <Option value="4+0">4+0</Option>
                  <Option value="4+1">4+1</Option>
                  <Option value="4.5+1">4.5+1</Option>
                  <Option value="4.5+2">4.5+2</Option>
                  <Option value="4+2">4+2</Option>
                  <Option value="4+3">4+3</Option>
                  <Option value="4+4">4+4</Option>
                  <Option value="5+1">5+1</Option>
                  <Option value="5.5+1">5.5+1</Option>
                  <Option value="5+2">5+2</Option>
                  <Option value="5+3">5+3</Option>
                  <Option value="5+4">5+4</Option>
                  <Option value="6+1">6+1</Option>
                  <Option value="6+2">6+2</Option>
                  <Option value="6.5+1">6.5+1</Option>
                  <Option value="6+3">6+3</Option>
                  <Option value="6+4">6+4</Option>
                  <Option value="7+1">7+1</Option>
                  <Option value="7+2">7+2</Option>
                  <Option value="7+3">7+3</Option>
                  <Option value="8+1">8+1</Option>
                  <Option value="8+2">8+2</Option>
                  <Option value="8+3">8+3</Option>
                  <Option value="8+4">8+4</Option>
                  <Option value="9+1">9+1</Option>
                  <Option value="9+2">9+2</Option>
                  <Option value="9+3">9+3</Option>
                  <Option value="9+4">9+4</Option>
                  <Option value="9+5">9+5</Option>
                  <Option value="9+6">9+6</Option>
                  <Option value="10+1">10+1</Option>
                  <Option value="10+2">10+2</Option>
                  <Option value="10 Üzeri">10 Üzeri</Option>
                </Select>
              </Form.Item>
            </Col>
            <Col span={6}>
              <Form.Item>
                <Button type="primary" htmlType="submit" style={{ width: '100%' }}>Ara</Button>
              </Form.Item>
            </Col>
          </Row>
        </Form>
      </div>
    </div>
  );
};

export default Home;
